import React from "react";
import User from "./components/user/user";
import Task from "./components/task/task";
import Card from "./components/cards/card";
import Navbar from "./shared/compoents/navbar";
import { BrowserRouter as Router, Route,Routes,Link,Navigate } from "react-router-dom";

const data = ['tea', 'coffee', 'water']

function App() {
  return (


    <React.Fragment>

      <Navbar />

      <hr/>

      <br></br>


      <Card title="I am a prop"></Card>




      <Router>

<Route path="/" exact > <Task></Task> </Route>

<Route path="/home" exact > <Card title="Bobby" /> </Route>

<Route path="create" exact> <User data={data}></User> </Route>

<Navigate to="/" />


</Router>





    </React.Fragment>





  );
}

export default App;
